    const instaEndpoint = `https://graph.facebook.com/${instaID}/media?fields=${instaFields}&limit=${imgAmount}&access_token=${accessToken}`;

    getInstaFeed = () => {
        fetch(instaEndpoint).then(res => console.log(res))
    }


    return (
        <div className='instagramContainer'>
            <p>{instaEndpoint}</p>
        </div>
    )
}
